const styles = (theme) => ({
  root: {
    ...theme.mixins.modal.dialog.root,
  },
  helpertext: {
    color: 'rgb(237, 172, 0)',
  },
  fileTypeGridNew: {
    marginTop: '25px',
  },
  fileTypeGrid: {
    marginTop: '5px',
  },
});
export default styles;
